import classes from "./Chat.css";

const Chat = props => {
  return (
    <div className={classes.container}>
      <div className={classes.header}>
        <div className={classes.header_nav}>
          <span>back</span>
          <span>Title</span>
        </div>
        <div className={classes.container}></div>
      </div>
    </div>
  );
};

export default Chat;
